# Site settings
title: Jarrett's Blog            # 博客标题
SEOTitle: Jarrett's Blog               # 显示在浏览器上搜索的时候显示的标题
header-img: img/post-bg-index.jpg    # 显示在首页的背景图片
# email: 754474446@qq.com            # 个人邮箱
description: "Every failure is leading towards success."  # 网站介绍
keyword: "jarrett, Java"  #关键词
url: "https://jarrett-98.github.io/"          # your host, for absolute URL；这个就是填写你的博客地址
baseurl: ""      # for example, '/blog' if your blog hosted on 'host/blog'
github_repo: "https://github.com/jarrett-98/jarrett-98.github.io.git" # you code repository

# Sidebar settings
sidebar: true                           # whether or not using Sidebar.
sidebar-about-description: "但行好事，莫问前程。"
sidebar-avatar: /img/will-wang.jpg      # use absolute URL, seeing it's used in both `/` and `/about/`



# SNS settings
RSS: false
weibo_username:     
zhihu_username:     
github_username:    jarrett-98
# facebook_username:  username
# jianshu_username:   jianshu_id
twitter_username:   
jianshu_id: 


# Build settings
# from 2016, 'pygments' is unsupported on GitHub Pages. Use 'rouge' for highlighting instead.
permalink: pretty
paginate: 10
exclude: ["less","node_modules","Gruntfile.js","package.json","README.md"]
anchorjs: true                          # if you want to customize anchor. check out line:181 of `post.html`



# Gems
# from PR#40, to support local preview for Jekyll 3.0
gems: [jekyll-paginate]




# Markdown settings
# replace redcarpet to kramdown,
# although redcarpet can auto highlight code, the lack of header-id make the catalog impossible, so I switch to kramdown
# document: http://jekyllrb.com/docs/configuration/#kramdown
markdown: kramdown
highlighter: rouge
kramdown:
input: GFM                            # use Github Flavored Markdown !important



